const Purchase = () => {
  const listCart= useSelector((state)=>state.itemReducer);
  const quantity= listCart.OnProcessing.reduce(function(result, item){return result + (item.quantity===0)?0:1;},0);
  return <div>
      <p>amount of product:{quantity}</p>
      <h4> price</h4>
      <button>purchase</button>
  </div>;
};

export default Purchase;
